import { useContext, useState } from 'react';
import { Link, useNavigate } from 'react-router-dom';
import AuthContext from '../context/AuthContext';

const Navbar = () => {
  const { user, logout } = useContext(AuthContext);
  const navigate = useNavigate();
  const isGuest = localStorage.getItem('guestMode');
  const [isMobileMenuOpen, setIsMobileMenuOpen] = useState(false);

  const handleGuestMode = () => {
    localStorage.setItem('guestMode', 'true');
    navigate('/guest/properties');
    setIsMobileMenuOpen(false);
  };

  const exitGuestMode = () => {
    localStorage.removeItem('guestMode');
    navigate('/');
    setIsMobileMenuOpen(false);
  };

  const handleLogout = () => {
    logout();
    setIsMobileMenuOpen(false);
  };

  return (
    <nav className="navbar">
      <div className="container">
      <Link 
  to={user?.role === 'admin' ? '/admin-dashboard' : 
       user?.role === 'landlord' ? '/landlord-dashboard' : 
       '/tenant-dashboard'} 
  className="navbar-brand"
>
  RentMate
</Link>        
        <button 
          className="mobile-menu-toggle" 
          onClick={() => setIsMobileMenuOpen(!isMobileMenuOpen)}
          aria-label="Toggle menu"
        >
          {isMobileMenuOpen ? '×' : '☰'}
        </button>
        
        <div className={`navbar-menu ${isMobileMenuOpen ? 'active' : ''}`}>
          {!user && !isGuest ? (
            <>
              <Link to="/properties" className="nav-link" onClick={() => setIsMobileMenuOpen(false)}>Browse Properties</Link>
              <Link to="/login" className="nav-link" onClick={() => setIsMobileMenuOpen(false)}>Login</Link>
              <Link to="/register" className="nav-link" onClick={() => setIsMobileMenuOpen(false)}>Register</Link>
              <button 
                onClick={handleGuestMode} 
                className="nav-link guest-mode-btn"
              >
                Continue as Guest
              </button>
            </>
          ) : isGuest ? (
            <>
              <Link to="/guest/properties" className="nav-link" onClick={() => setIsMobileMenuOpen(false)}>Browse Properties</Link>
              <Link to="/login" className="nav-link" onClick={() => setIsMobileMenuOpen(false)}>Login</Link>
              <Link to="/register" className="nav-link" onClick={() => setIsMobileMenuOpen(false)}>Register</Link>
              <button 
                onClick={exitGuestMode} 
                className="nav-link exit-guest-btn"
              >
                Exit Guest Mode
              </button>
            </>
          ) : (
            <>
              {user.role === 'Admin' && (
                <>
                  <Link to="/admin/dashboard" className="nav-link" onClick={() => setIsMobileMenuOpen(false)}>Dashboard</Link>
                  <Link to="/admin/pending-landlords" className="nav-link" onClick={() => setIsMobileMenuOpen(false)}>Pending Landlords</Link>
                  <Link to="/admin/pending-properties" className="nav-link" onClick={() => setIsMobileMenuOpen(false)}>Pending Properties</Link>
                </>
              )}
              
              {user.role === 'Landlord' && (
                <>
                  <Link to="/landlord/dashboard" className="nav-link" onClick={() => setIsMobileMenuOpen(false)}>Dashboard</Link>
                  <Link to="/landlord/properties" className="nav-link" onClick={() => setIsMobileMenuOpen(false)}>My Properties</Link>
                  <Link to="/landlord/proposals" className="nav-link" onClick={() => setIsMobileMenuOpen(false)}>Proposals</Link>
                </>
              )}
              
              {user.role === 'Tenant' && (
                <>
                  <Link to="/tenant/dashboard" className="nav-link" onClick={() => setIsMobileMenuOpen(false)}>Dashboard</Link>
                  <Link to="/properties" className="nav-link" onClick={() => setIsMobileMenuOpen(false)}>Browse Properties</Link>
                  <Link to="/saved-posts" className="nav-link" onClick={() => setIsMobileMenuOpen(false)}>Saved Posts</Link>
                </>
              )}
              
              <Link to="/messages" className="nav-link" onClick={() => setIsMobileMenuOpen(false)}>Messages</Link>
              {/* <Link to="/profile" className="nav-link" onClick={() => setIsMobileMenuOpen(false)}>Profile</Link> */}
              <button onClick={handleLogout} className="nav-link logout-btn">
                Logout
              </button>
            </>
          )}
        </div>
      </div>
    </nav>
  );
};

export default Navbar;
